Тобольск','Татьяна Владимировна','oka@ursma.ru',35000,'г.Тобольск ООО «Уралсибмонтажавтоматика» - это энергично развивающееся предприятие, осуществляющее свою деятельность по направлениям: электроэнергетика, автоматизация, охранно-пожарные системы. Приглашаем на работу сметчика.\r\nОбязанности:\r\n1. Ежемесячное составление документов (КС-6а, КС-2, КС-3) для предъявления выполненных работ Заказчику.\r\n2. Заполнение формы М-29 (отчет о расходе основных материалов) в части расхода материалов по нормам.\r\n3. Составление сметной документации на СМР и ПНР (КИПиА, АСУ ТП, ЭР, ОПС).\r\n4. Подготовка расчетов для участия в тендерах.\r\n5. Проверка сметной документации, полученной от Заказчика.\r\nТребования:\r\n1. Высшее профессиональное образование,\r\n2. PC - пользователь (WinWord, Excel, Internet, Office Outlook). Программы: ГРАНД-Смета, Стройконсультант.\r\n',0,1,5,NULL),(29,0,1,1516950986,1516950986,1519542986,'Фундамент','Трухин Максим Владимирович','9226100204@mail.ru',0,'Требуется смета на фундаментные работы. Объект: Молочный завод г. Новоуральск Свердловская область, фундамент под  \"Фреоновую установку\". Фундамент будет заливаться в феврале-марте, помещение крытое. Копка котлована не требуется.',0,1,5,NULL),(31,0,NULL,1517051006,1517051006,1519643006,'Благоустройство двух дворовых территории  1,3га 1,9га','Целищев Александр Петрович','spubl@mail.ru',40000,'Сметные расчеты, содержащиеся в документации, должны соответствовать физическим объемам работ, конструктивным, организационно - технологическим и другим решениям, предусмотренным проектной документацией.\r\n Сметную документацию разработать базисно - индексным методом в программе WinRik в нормативной базе 2001г. и в новой нормативной базе ТСНБ-2001г. Калининградской области в редакции 2014 года с изменениями 1 с пересчетом в текущие цены (в соответствии с приказом Министерства строительства и ЖКХ Калининградской области от 18.03.2011г. № 14-ОД);\r\nСметной документации разработать следующие альбомы:\r\n- протоколы согласования цены;\r\n- прайс-листы;\r\n- ведомость объемов работ.',0,1,5,NULL),(30,363,1,1516953785,1517210719,1517210719,'Нужно увеличить смету','Роза','zenulik@mail.ru',0,'\"Сетевая компания\" Надо увеличить смету из 1 900 000на 2 600 000. Проект есть. Смета в гранд. Прошу писать на почту, а не звонить.',0,1,2,NULL),(32,0,NULL,1517377766,1517377766,1519969766,'Составление смет в АВС-4','Липин Александр','spk.stroigorod@yandex.ru',0,'Требуется составление сметной документации в программе АВС-4.',1,1,NULL,NULL),(33,0,0,1518431621,1518432554,1521024554,'Смета на пир срочно','Чеснокова Роза ','Zenulik@mail.ru',0,'Пишите, я вышлю задание. Сделать надо в течении часв. Это  реально? ',1,1,NULL,NULL),(34,0,0,1518599580,1519118437,1519118437,'Локальная смета для СМР','Михаил','9344736@gmail.com',3500,'ТЕР Челябинской области. \r\nНеобходимо выполнить локальную смету на СМР по Рабочей документации.\r\nОсновной раздел ОВ - вентиляция. (установка для фильтрации сварочных дымов). + Эту установку в смежных разделах  подключаем к сжатому воздуху (ВС),  электросети (ЭМ), и в разделе КМ 2 отверстия в кровлю.',0,1,1,NULL),(35,0,NULL,1518676000,1518760500,1518760500,'Склад. Усиление.','Владов Виктор','vladov@stalkonspb.ru',0,'Смета должна быть составлена в ГЭСН в прораме град-смета, ресурсный метод.\r\nПриказ Минстроя России от 28.02.2017г. № 502/пр в ТЕР Мурманской области база 2014г. с изменениями 1. \r\n',0,1,1,NULL),(36,0,0,1518944412,1519832549,1519832549,'Расчет количества каналов для пусконаладки АСУТП','Марина','ivmarina2016@yandex.ru',0,'Требуется произвести Расчет количества каналов для пусконаладки АСУТП и составить смету.',0,1,1,NULL),(37,0,NULL,1524572115,1524572115,1525436115,'erwerwer','rwerwer','mail@mail.mail',32,'dasdas',1,0,NULL,NULL),(38,0,NULL,1524572123,1524572123,1525436123,'erwerwer','rwerwer','mail@mail.mail',32,'dasdas',1,0,NULL,NULL),(39,0,NULL,1524572129,1524572129,1525436129,'erwerwer','rwerwer','mail@mail.mail',32,'dasdas',1,0,NULL,NULL),(40,0,N